import React from 'react'

const AddButon = () => {
  return (
    <div className="fixed-action-btn">
        <a href="#add-event-modal" className="btn-floating btn-large waves-effect waves-light blue-grey">
            <i className="material-icons">add</i>
        </a>         
    </div>    
  )
}
export default AddButon
